import React from "react";

function Selector() {
    return (
        <div>
            <button>Radon</button>
            <button>BC-MAAP</button>
            <button>BC-Magee</button>
            <button>MP-GRIMM</button>
            <button>Multi-parametro</button>
            <button>Radiometro</button>
        </div>
    )
}

export default Selector;
